@nguyeho7 I haven't tried the trick on faster-rcnn architecture but I believe it will perform in a similar way. The point is **the graph nodes have to be assigned to GPU or CPU accordingly** to achieve the reported inference speed. The trick here is not the optimal way to assign the nodes as @tokk-nv mentioned above. Apparently the device tags are initially there and then removed in these frozen graphs. So **these released frozen graphs  cannot achieve the reported inference speed**.

@derekjchow Since the **frozen graphs cannot achieve the reported inference speed due to the lack of optimal device assignment**, I think the **tensorflow team should provide**:
* A description of inference speed issue somewhere in the object detection API documentation;
* A version of frozen graphs with device tags for best inference speed on GPU
* Or, a way to recover the original device placement config for those frozen models currently listed in the Object Detection Model Zoo.

